  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains analytical data
  from samples acquired from the Baltimore Canyon (Mid-Atlantic) area of the n          Outer
  Continental Shelf, U.S. East Coast, by the U.S. Geological Survey, Office of Marine
  Geology, Woods Hole, Mass., during the first n          year of environmental assessment
  work funded by the Bureau of Land Management (June 1975 - August 1976), on cruises
  of the ships n          Atlantis II, Advance II, Columbus Iselin, Pierce, and Gillis.
  The data set contains ten files. The first file (\"station data\") contains n          location
  and collection documentation for the subsequent files which contain the various
  analytical data. Data files include: baltcanyon.1.txt - n          collection documentation,
  baltcanyon.2.txt - grain size of sediments, baltcanyon.3.txt - high molecular weight
  hydrocarbons, baltcanyon.4.txt - n          hydrocarbon contaminant and intercalibration
  samples, baltcanyon.5.txt - trace metals, baltcanyon.6.txt - carbon content, baltcanyon.7.txt
  - n          suspended sediment (see note), baltcanyon.8.txt - suspended matter,
  baltcanyon.9.txt - clay mineralogy, baltcanyon.10.txt - carbon-14 dates, n          readme.txt
  - full documentation for above.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
